// ==UserScript==
// @name          Colour-reduced Slack workspace
// @include       http://slack.com/*
// @include       http://*.slack.com/*
// @include       https://slack.com/*
// @include       https://*.slack.com/*
// @run-at        document-start
// @version       1.0.0-beta1
// @grant         none
// ==/UserScript==

(function() {
    var css = `
    html, body, input, select, textarea {
        font-size: 13px !important;
    }

    .p-rich_text_block,
    .c-message_attachment__text,
    .c-message__body,
    .c-message_kit__text,
    .p-ia__view_header__metadata,
    .p-message_pane__foreword_description__container_body {
        direction: rtl;
        text-align:right;
        font-family: DroidNaskh, Roboto, tahoma, sans-serif !important;
        font-size: 13px!important;
        line-height: 20px!important;
    }

    .c-message_kit__text {
        float: right;
    }

    .c-message_attachment__text {
        font-size: 12px!important;
    }

    .c-message__body {
        direction: ltr!important;
    }

    .p-ia__view_header__metadata {
        font-size: 11px!important;
    }

    .c-message_kit__thread_message .c-message_kit__gutter__right,
    .c-message_kit__gutter .c-message_kit__gutter__right {
        padding-right: 0;
        background-color: #f8f8f8;
        border-radius: 6px;
        border: 1px solid #e0e0e0;
        margin: -10px 0 0 0;
        padding: 0 10px 5px 2px;
    }

    .p-rich_text_section {
        padding: 9px 0 0 5px;
    }

    .c-reaction {
        /*background-color: whitesmoke!important;*/
    }

    .ql-editor, .ql-editor:focus {
        font-family: DroidNaskh, Roboto, tahoma, sans-serif !important;
        direction: rtl;
        text-align:right;
    }

    .c-mrkdwn__pre, .c-mrkdwn__code {
        direction: ltr;
        text-align: left;
    }

    .c-mrkdwn__pre {
        float: left;
    }

    .p-channel_sidebar,
    .p-channel_sidebar__section_heading,
    .p-ia__sidebar_header {
        background-color: #212121 !important;
        background-image: url("data:image/png;base64,")!important;
    }

    .p-ia__sidebar_header__button {
        border-color: #545454!important;
    }

    .p-top_nav {
        background-image: url("data:image/png;base64,")!important;
    }

    .c-message_kit__message,
    .p-message_pane .c-virtual_list__sticky_container,
    .p-threads_flexpane_container .c-virtual_list__scroll_container .c-virtual_list__item ,
    .p-message_pane_input {
        background-image: url("data:image/png;base64,");
    }

    .p-workspace__secondary_view {
        border-left: 1px solid rgba(118, 119, 119, 0.37)!important;
    }

    .p-top_nav__search {
        background: rgba(37, 34, 34, 0.45)!important;
        box-shadow: inset 0 0 0 1px rgb(109, 105, 109)!important;
    }

    .c-avatar {
        filter: grayscale(1);
    }

    .c-avatar:hover {
        filter: grayscale(0);
    }

    .c-message__reply_bar > .c-avatar {
        display: none!important;
    }

    .c-message_kit__thread_replies.c-message__reply_bar {
        margin-left: 5px;
    }

    .c-base_icon {
        border-radius: 50%!important;
    }

    .c-message__reply_count:before {
        content: '\\25BA';
        color: #d41414;
        padding-right: 5px;
    }

    .p-channel_sidebar__channel:hover,
    .p-channel_sidebar__channel--context,
    .p-channel_sidebar__link:hover,
    .p-channel_sidebar__channel:hover .p-channel_sidebar__user_avatar_presence_bg,
    .p-channel_sidebar__close_container:hover,
    .p-top_nav__button:hover,
    .p-setup_escape_hatch:hover,
    .p-top_nav__sidebar .p-channel_sidebar__history_button:hover {
        background: #204561!important;
    }

    .p-rich_text_list__bullet li:before {
        margin: 0 5px;
    }

    .c-texty_input .ql-editor {
        font-size: 13px!important;
    }

    @font-face {font-family: 'DroidNaskh';src: url("data:application/font-woff;charset=utf-8;base64,") format('woff2');}
    @font-face {font-family: 'DroidNaskh';src: url("data:application/font-woff;charset=utf-8;base64,") format('woff2');font-weight: bold;}"
    `;

    var node = document.createElement("style");
    node.type = "text/css";
    node.appendChild(document.createTextNode(css));

    var heads = document.getElementsByTagName("head");
    if (heads.length > 0) {
        heads[0].appendChild(node);
    } else {
        document.documentElement.appendChild(node);
    }

    function ready(fn) {
        if (document.readyState != 'loading'){
            fn();
        } else {
            document.addEventListener('DOMContentLoaded', fn);
        }
    }

    ready(function(){
        // TODO: Adopting text direction based on innerText or input in case of `textarea/input`
    });

})();

